Information
------------------------------

Mortality and death have always fascinated humankind. Civilizations from all over the world have practiced mummification as a means of preserving life after death--a ritual which captures the imagination of scientists, artists, and public alike. 
For nearly everyone the words &quot;pyramids&quot; and &quot;mummies&quot; evoke images of ancient Egypt. Yet those intriguing cultural artifacts are by no means unique to the Land of the Pharoahs. As this collection vividly demonstrates, they are found around the world, including the Americas. Indeed, the oldest mummies in the world, and some of the most sophisticated anywhere, come not from the Nile Valley but from the Atacama Desert in Chile. Mummies have always been with us, and today we turn to them with ever more advanced and refined methods and learning their deep secrets.

4)  Oasis of the Golden Mummies 
A spectacular discovery in 1999 unearthed one hundred and five sumptuously decorated mummies at the Bahariya Oasis in Western Egypt. Dr. Zahi Hawass and team of Egyptian archaeologists excavated four beautifully gilded tombs, which contained an astonishing collection of Roman mummies. These exciting finds are re-writing the history of Egypt, centuries after Alexander the Great was Pharaoh, Romans and Egyptians were still embroiled in a battle for power. This year Discovery Channel follows Dr. Hawass as he returns to unveil the tombs he believes have been untouched since antiquity. Were corrupt Roman entrepreneurs hijacking the religious practice of Egyptian mummification? Now it is time to enter the greatest tomb of the Bahariya Oasis and uncover the secrets of the Golden Mummies.

